import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { io } from "socket.io-client";
import { Table, Button, Switch, Layout, theme } from "antd"; // Import Ant Design
import {
    FaSignOutAlt, FaMoon, FaSun, FaCalendarAlt
} from "react-icons/fa";
import "./Home.css";
import axios from "axios";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const { Header, Content } = Layout;
const socket = io("http://localhost:5000");

const Home = ({ user, token }) => {
    const [schedule, setSchedule] = useState([]);
    const [darkMode, setDarkMode] = useState(false);
    const navigate = useNavigate();
    const [currentUser, setCurrentUser] = useState(user || JSON.parse(localStorage.getItem("user")));

    useEffect(() => {
        if (currentUser?.role === "gv") {
            fetchTeachingSchedule(currentUser.id);
        }
    }, [currentUser]);

    const fetchTeachingSchedule = async (teacherId) => {
        try {
            const response = await axios.get(`http://localhost:5000/teacher/teacher/classes/${teacherId}`);
            setSchedule(response.data);
        } catch (error) {
            toast.error("⚠️ Không thể tải lịch dạy!");
        }
    };

    const handleCancelTeaching = async (classId) => {
        try {
            const response = await axios.delete(`http://localhost:5000/teacher/unregister-class/${currentUser.id}/${classId}`);
            if (response.status === 200) {
                toast.success("✅ Hủy đăng ký thành công!");
                fetchTeachingSchedule(currentUser.id);
                socket.emit("teachingUnregistered", { teacherId: currentUser.id, classId });
            }
        } catch (error) {
            toast.error("❌ Không thể hủy đăng ký!");
        }
    };

    const toggleDarkMode = () => {
        setDarkMode(!darkMode);
        document.body.classList.toggle("dark-mode", !darkMode);
        localStorage.setItem("darkMode", !darkMode);
    };

    const handleLogout = () => {
        localStorage.removeItem("user");
        setCurrentUser(null);
        navigate("/login");
    };

    if (!currentUser) return <p>Đang tải...</p>;

    const columns = [
        { title: "Tên lớp", dataIndex: "name", key: "name" },
        { title: "Loại lớp", dataIndex: "type_mapped", key: "type_mapped" },
        { title: "Khối", dataIndex: "grade", key: "grade" },
        { title: "Số học sinh", dataIndex: "current_student", key: "students", render: (_, record) => `${record.current_student} / ${record.max_student}` },
        { title: "Lịch dạy", dataIndex: "schedule", key: "schedule", render: (schedule) => schedule.split(", ").map((s, i) => <div key={i}>{s}</div>) },
        {
            title: "Hành động",
            key: "action",
            render: (_, record) => (
                <Button type="primary" danger onClick={() => handleCancelTeaching(record.id)}>
                    Hủy đăng ký
                </Button>
            ),
        },
    ];

    return (
        <Layout style={{ minHeight: "100vh", background: darkMode ? "#001529" : "#fff" }}>
            <Header style={{ display: "flex", justifyContent: "space-between", alignItems: "center", background: darkMode ? "#000c17" : "#1890ff" }}>
                <h2 style={{ color: "white" }}>Lịch Dạy Của Tôi</h2>
                <div>
                    <Button type="text" onClick={toggleDarkMode} icon={darkMode ? <FaSun /> : <FaMoon />} />
                    <Button type="text" danger onClick={handleLogout} icon={<FaSignOutAlt />} />
                </div>
            </Header>
            <Content style={{ padding: "20px" }}>
                <Table columns={columns} dataSource={schedule} rowKey="id" bordered pagination={{ pageSize: 5 }} />
            </Content>
        </Layout>
    );
};

export default Home;
